import React from 'react';
import classes from './Sidebar.module.css';
import MenuItem from './MenuItem/MenuItem';

const sidebar = (props) => {

    let data = [
        {link: 'Home',
        subLink: ['test1', 'test2', 'test3', 'test4']},
        {link: 'Shomchial Shemdia',
        subLink: ['test1', 'test2', 'test3', 'test4']},
        {link: 'Shop',
        subLink: ['test1', 'test2', 'test3', 'test4'] },

    ]

    let AllItems = data.map((dataItem, index) => {
        return (
            <div className={classes.NavList}>
            <ul>
                <li key={index}>

                    {dataItem.link}

                </li>
            </ul>
            </div>
        )
    }
    )

    return (
    <div className={classes.Sidebar}>
        {AllItems}
    </div>
    )
    };
export default sidebar;
